import React from "react"

import "./Boxlink.css"

function Boxlink(props){
    let boxClass;
    if(props.box.shape == "square")
        boxClass = "boxlink__square"
    else
        boxClass = "boxlink__rechtangle"

    return(
        <div className={boxClass}>
            <a href="/">
                <h3>
                    {props.box.case}
                </h3>
            </a>
        </div>
    )
}

export default Boxlink
